import Pluralize from 'pluralize';
import $store from './store';
import templates from '@/assets/data/templates.json';
import CategoryTypes from '@/assets/data/types.json';

/******************classes*******************/
class Datatype {
    constructor (id, display) {
        this.id = id;
        this.display = display;
    }
}

export class TableSettings {
    constructor (key, expand, heading, description, toggleIcon, networkIcon, resultsPerPage = true, highlight = false, hideableColumns = false, defaultSortBy = 'headline', defaultSortDesc = false, defaultRowFilter = false) {
        this.rowKey = key;
        this.highlight = highlight;
        this.expand = expand;
        this.tableHeading = heading;
        this.tableDescription = description;
        this.showToggleIcon = toggleIcon;
        this.showNetworkIcon = networkIcon;
        this.showResultsPerPage = resultsPerPage;
        this.hideableColumns = hideableColumns;
        this.defaultSortBy = defaultSortBy;
        this.defaultSortDesc = defaultSortDesc;
        this.rowfilter = defaultRowFilter;
    }
}

export class HeaderConfig {
    constructor (text, align = 'start', sortable = true, value, assignWidth = true, hideable = false) {
        this.text = text;
        this.align = align;
        this.sortable = sortable;
        this.value = value;
        //adjusting header row width based on content
        if(assignWidth) {
            this.width = text === 'Arguments' ? '8%' :
                align === 'center' || text === 'Date' || value === TABLEFIELDMAPPING.percentage ? '2%' :
                value === TABLEFIELDMAPPING.nodeCount || value === TABLEFIELDMAPPING.entityCount ? '5%' :
                text === 'Description' || text === 'Statement' ? '35%' : '24%';
        }
        this.hideable = hideable;
    }
}

export class SecondaryCaption {
    constructor (prototype, field, key) {
        this.prototype = prototype;
        this.field = field;
        this.key = key;
    }
}

export class SecondaryExpand {
    constructor (prototype, field, headers) {
        this.prototype = prototype;
        this.field = field;
        this.headers = headers;
    }
}

/******************constant variables*******************/
export const DATATYPES = {
    argumentName : new Datatype('argument', 'Argument Name'),
    topic : new Datatype('topic', 'Topics'),
    subtopic : new Datatype('subtopic', 'Sub Topics'),
    template : new Datatype('template', 'Claim Templates'),
    entityType : new Datatype('entity', 'Argument Type' ),
    eventType : new Datatype('event', 'Event Type' ),
    confidenceThreshold : new Datatype('confidence', 'Confidence Threshold' ),
    connectionHops : new Datatype('hops', 'Connection Hops' ),
    dateRange : new Datatype('date', 'Date Range' ),
    hypothesis : new Datatype('hypothesis', 'Hypothesis' ),
    kbId : new Datatype('kbId', 'KB ID' ),
    relationType : new Datatype('relation', 'Relation Type' ),
    sin : new Datatype('sin', 'Incidents' ),
    summary : new Datatype('summary', 'Summaries')
};

//Sorted based on visual preference - for hypotheses data
export const ERETYPES = [DATATYPES.eventType.id, DATATYPES.entityType.id, DATATYPES.relationType.id];

export const QUERYOPTIONS = {
    [DATATYPES.argumentName.id] : DATATYPES.argumentName.display,
    [DATATYPES.sin.id] : DATATYPES.sin.display
    /*            TODO: Add these options as autocomplete functionality becomes available
                [DATATYPES.eventType.id] : DATATYPES.eventType.display,
                [DATATYPES.entityType.id] : DATATYPES.entityType.display,
                [DATATYPES.relationType.id] : DATATYPES.relationType.display,
                [DATATYPES.kbId.id] : DATATYPES.kbId.display,
                [DATATYPES.hypothesis.id] : DATATYPES.hypothesis.display*/
};

export const COMPONENTNAMES = {
    multiSelect : 'MultiSelectAutoComplete',
    dateRange : 'DateFilter'
}

export const TA2TERMOPTIONS = {
    [DATATYPES.argumentName.id] : DATATYPES.argumentName.display
};

export const TA3TERMOPTIONS = {
    //[DATATYPES.hypothesis.id] : DATATYPES.hypothesis.display,
    [DATATYPES.sin.id] : DATATYPES.sin.display
};

export const SELECTDISPLAY = {
    button : 'button',
    text : 'text',
    underline : 'underline',
    input: 'input'
};

export const PREFIXTYPES = {
    dash: '-',
    dot:'.',
    hash: '#',
    hashscore:'#_',
    underscore: '_',
    slash: '/'
};

export const JOINSTRING = '___';

export const DATADISPLAY = {
    count : 'count',
    list : 'list'
};

export const TABLESELECTIONS = {
    tab : 'selectedTab',
    display : 'selectedDisplay',
    sort : 'sort',
    sortDesc : 'descending',
    sortBy : 'by',
    paging: 'pagination',
    itemsPerPage: 'itemsPerPage',
    pageNumber: 'page',
    pageStart: 'pageStart'
