export const TABLEFIELDMAPPING = {
    //new api fields
    affiliation: 'affiliation',
    clusterUri: 'cluster',
    clusterCategory: 'cluster_category',
    clusterType: 'cluster_type',
    prototype: 'prototype',
    prototypeUri: 'prototype_uri',
    prototypeId: 'prototype_id',
    names: 'names',
    headline: 'headline',
    statement: 'statement',
    documentList: 'docs',
    docId: 'document_id',
    docTitle: 'document_title',
    docContentDate: 'document_contentdate',
    docDownloadDate: 'document_downloaddate',
    documentCount: 'docs_count', //calculated in the data formatting process
    idUri: 'id_uri',
    id: 'id',
    ke: 'ke',
