export const VUEROUTES = {
    doc: '/' + ta1Route + '/doc',
    ta2: ta2Route,
    cluster: '/' + ta2Route + '/cluster_details',
    element: '/' + ta2Route + '/element_details',
    ta3: ta3Route,
    claims: claimRoute,
    hypothesis: '/' + ta3Route + '/hypothesis_details'
