export const SEARCHTYPES = {
    single : 'singleSelect',
    multi : 'multiSelect'
};

export const INCIDENTMAPPING = [
    { id:'E201', value: 'Death of Hugo Chvez'},
    { id:'E202', value: '"Mother of All Marches" during 2017 Protests in Venezuela'},
    { id:'E203', value: 'Helicopter Attack in Caracas'}
