/******************helper functions*******************/
export function ta3DataSource (source) {
    return source.includes('TA3');
}

export function ta2DataSource (source) {
    return source.includes('TA2');
}

export function getIncidentName(sinId) {
    return INCIDENTMAPPING.find(elem => elem.id === sinId ? elem : '').value;
}

export function getIncidentId(sinName) {
    return INCIDENTMAPPING.find(elem => elem.value === sinName ? elem : '').id;
}

export function getSinIdFromDataSource (source) {
    let truncateSource = source.replace(DATASOURCEURI, '');
    truncateSource = truncateSource.substring(truncateSource.indexOf('/') + 1);
    return truncateSource.substring(0, truncateSource.indexOf('/'));
}

export function upperFirstLetter(text) {
    return text.charAt(0).toUpperCase() + text.slice(1);
}

export function charReplace(str, char) {
    char = typeof char === 'undefined' ? '_' : char;
    return str.replace(/\s/g, char);
}

export function lowerCharReplace(str, char) {
    return charReplace(str.toLowerCase(), char);
}

export function splitOnUpper(textString) {
    return textString.split(/(?=[A-Z])/).join(' ');
}

export function pluralize(str) {
    return Pluralize(str);
}

export function prettyPluralize(str) {
    return pluralize(upperFirstLetter(str));
}

export function removePrefix(textString, type) {
    let newString = textString;

    if(textString) {
        const hashPosition = textString.lastIndexOf(PREFIXTYPES.hash);

        if (type === PREFIXTYPES.hash) {
            newString = textString.substring(hashPosition + 1, textString.length);
        } else if (type === PREFIXTYPES.hashscore) {
            let underscorePosition = textString.lastIndexOf(PREFIXTYPES.underscore);
            newString = textString.substring(hashPosition + 1, underscorePosition);
        } else if ([PREFIXTYPES.underscore, PREFIXTYPES.dot, PREFIXTYPES.dash, PREFIXTYPES.slash].includes(type)) {
            newString = textString.substring(textString.lastIndexOf(type) + 1, textString.length);
        }
    }
    return newString;
}

export function cleanName (name) {
    let nameSplit = name.split(' ');

    //move starting numbers to the end of the name string for sorting correction in the Vuetify autocomplete component
    if(!isNaN(parseInt(nameSplit[0]))) {
        const num = nameSplit[0];
        let nameSlice = nameSplit.slice(1);
        nameSlice.push(num);
        nameSplit = nameSlice;
    }

    // eslint-disable-next-line no-useless-escape
    return nameSplit.join(' ').replace(/[/"\\#]/g, '').trim();
}

export function sortCaseInsensitive (array) {
    return array.sort((current, previous) => current.toLowerCase().localeCompare(previous.toLowerCase()));
}

export function sortArrayOfObjects (array, key) {
    return array.sort((a, b) => (a[key].toLowerCase() > b[key].toLowerCase()) ? 1 : -1);
}

export function arraysMatch (arrOne, arrTwo) {
    return arrOne.length === arrTwo.length &&
    arrOne.every((element) =>  arrTwo.includes(element));
}

export function buildRoute(id, path, suffix, params) {
    const encodedId = encodeURIComponent(id);
    let route = suffix ? [path, suffix, encodedId].join('/') : [path, encodedId].join('/');
    if(params && params.length > 0) {
        for (let i = 0; i < params.length; i++) {
            route += i === 0 ? '?' : '&';
            route += params[i].key + '=' + encodeURIComponent(params[i].value);
        }
    }
    return route;
}

export function convertTA3toTA2Route(ta3Route) {
    return ta3Route.replace(/TA3\/[^/]*\/[^/]*\//, 'TA2/');
}

export function getStringValue(value) {
    return Array.isArray(value) ?  value.join(', ') : value;
}

export function getSortedTypes(types) {
    return sortCaseInsensitive(types.map(getType));
}

export function getLastSubType(t) {
    return t.substring(t.lastIndexOf('.') + 1, t.length);
}

export function getTransformedType(t, mapping) {
    return t ? mapping[t] || splitOnUpper(getLastSubType(t)) : null;
}

export function deduplicateArray(array) {
    return [...new Map(array.map(item => [item.id, item])).values()];
}

export function getType(type) {
    return removePrefix(type, PREFIXTYPES.hash);
}

export function getRole(role) {
    return removePrefix(role, PREFIXTYPES.underscore);
}

export function makePercentage(value, precision) {
    return (value * 100).toFixed(precision);
}

function getName(entity, showNameCount=true) {
    //appending the additional names count to the name string
    let nameString = '';

    if(entity.names && entity.names[0]) {
        let index = 0;
        let placeholder = -1;
        let count = entity.names.length - 1;

        //check if the argument search term exists in the list of names. If it does return it as the canonical name.
        if($store.getters.getQueryParams.term && $store.getters.getQueryParams.term.input) {
            placeholder = entity.names.findIndex(name => {
                return name.toLowerCase() === $store.getters.getQueryParams.term.input.toLowerCase()
            });
        }

        nameString = entity.names[placeholder > -1 ? placeholder : index];

        //Add the count for the remaining names in the list
        if(count > 0 && showNameCount) {
            nameString = nameString + ' ('  + count + ' more)';
        }
    }
    else if (entity.handle) {
        nameString = entity.handle;
    }

    return nameString;
}

export function getId(uri) {
    return removePrefix(removePrefix(uri, PREFIXTYPES.hash), PREFIXTYPES.slash)
}

function getClusterIdObject(uri) {
    return {
        [TABLEFIELDMAPPING.idUri]:uri,
        [TABLEFIELDMAPPING.id]:removePrefix(removePrefix(uri, PREFIXTYPES.hash), PREFIXTYPES.slash)
    };
}

/******************formatting functions*******************/

function createMember(member, category, entities, clusters) {
    return {
        [TABLEFIELDMAPPING.headline]: member.id,
        [TABLEFIELDMAPPING.idUri]: member.id,
        [TABLEFIELDMAPPING.id]: getId(member.id),
        [TABLEFIELDMAPPING.types]: getSortedTypes(member.types),
        [TABLEFIELDMAPPING.entityCount]: entities.length,
        [TABLEFIELDMAPPING.entityList]: entities,
        [TABLEFIELDMAPPING.nodeCount]: clusters && clusters.length,
        [TABLEFIELDMAPPING.clusterList]: clusters,
        [TABLEFIELDMAPPING.category]: category,
        [TABLEFIELDMAPPING.documentList]: member.docs
    };
}

//Formatting event or relation cluster details
export function formatCluster(data, category) {
    let cluster =  {
        [TABLEFIELDMAPPING.headline]: category === DATATYPES.hypothesis.id ? getName(data) : getId(data.cluster),
        [TABLEFIELDMAPPING.names]: data.names,
        [TABLEFIELDMAPPING.id]: getId(data.cluster),
        [TABLEFIELDMAPPING.category]: data.category? getType(data.category).toLowerCase() : category,
        [TABLEFIELDMAPPING.clusterUri]: data.cluster
    };

    if(data.hasOwnProperty(TABLEFIELDMAPPING.prototype)) {
        cluster[TABLEFIELDMAPPING.prototype] = formatClusterElement(data.prototype, category);
        cluster[TABLEFIELDMAPPING.prototypeUri] = data.prototype.id;
        cluster[TABLEFIELDMAPPING.prototypeId] = getId(data.prototype.id);
        cluster[TABLEFIELDMAPPING.types] = getSortedTypes(data.prototype.types);
        cluster[TABLEFIELDMAPPING.entityCount] = cluster[TABLEFIELDMAPPING.prototype][TABLEFIELDMAPPING.entityCount];
    }

    if(category !== DATATYPES.hypothesis.id) {
        cluster[TABLEFIELDMAPPING.nodeCount] = data.members ? data.members.length : 0;
        cluster[TABLEFIELDMAPPING.nodes] = data.members.map(member => formatClusterElement(member, category));
        cluster[TABLEFIELDMAPPING.documentList] = sortArrayOfObjects([...new Set(data.members.flatMap(member => member.docs))], 'id')
    }
    else {
        cluster[TABLEFIELDMAPPING.highlight] = data[TABLEFIELDMAPPING.highlight] ? data[TABLEFIELDMAPPING.highlight] : false;
    }

    return cluster;
}

//Formatting entity clusters for hypothesis
export function formatHypothesisEntities(data) {
    const entities = data && data.map(entity => {
        //Only collect the fillers that are entities - some event fillers may exist (event to event connections)
        if(getType(entity.category).toLowerCase() === DATATYPES.entityType.id) {
            return {
                [TABLEFIELDMAPPING.headline]: getName(entity),
                [TABLEFIELDMAPPING.names]: entity.names,
                [TABLEFIELDMAPPING.clusterUri]: entity.clusterIds[0],
                [TABLEFIELDMAPPING.types]: getSortedTypes(entity.types),
                [TABLEFIELDMAPPING.prototypeId]: getId(entity.id),
                [TABLEFIELDMAPPING.id]: getId(entity.clusterIds[0]),
                [TABLEFIELDMAPPING.category]: 'entity',
                [TABLEFIELDMAPPING.highlight] : entity[TABLEFIELDMAPPING.highlight] ? entity[TABLEFIELDMAPPING.highlight] : false
            }
        }
    });

    //deduplicate entities
    return deduplicateArray(entities.filter(item => item !== undefined));
}

//Formatting hypothesis details
export function formatHypothesisCluster(data, category) {
    const members = deduplicateArray(data.members.map(member => formatCluster(member, category)));
    return  {
        [TABLEFIELDMAPPING.headline]: getId(data.hypothesis),
        [TABLEFIELDMAPPING.idUri]: data.hypothesis,
        [TABLEFIELDMAPPING.entityList] : formatHypothesisEntities(data.fillers),
        [TABLEFIELDMAPPING.category]: category,
        [TABLEFIELDMAPPING.eventList] :members.filter(member => getType(member.category).toLowerCase() === DATATYPES.eventType.id),
        [TABLEFIELDMAPPING.relationList] : members.filter(member => getType(member.category).toLowerCase() === DATATYPES.relationType.id),
        [TABLEFIELDMAPPING.documentList]: sortArrayOfObjects(data.docs, 'id'),
    };
}

export function getSinArgumentHeadline(argument) {
    return argument.handle || getName(argument) || 'UNKNOWN';
}

function formatSinHypothesisArguments(roles, memberType) {
    const ret = [];

    for (let role of roles) {
        for (let argument of role.arguments)  {
            ret.push({
                [TABLEFIELDMAPPING.headline]: getSinArgumentHeadline(argument),
                [TABLEFIELDMAPPING.names]: argument.names,
                [TABLEFIELDMAPPING.roleUri]: [role.role],
                [TABLEFIELDMAPPING.roles]: [getRole(role.role)],
                [TABLEFIELDMAPPING.id]: getId(argument.id),
                [TABLEFIELDMAPPING.prototypeUri]: argument.prototype,
                [TABLEFIELDMAPPING.types]: argument.types.length > 0 ?  sortCaseInsensitive(argument.types.map(getType)) : ['UNKNOWN'],
                discrepancy: !role.role.includes(memberType) ? '(err: ' + getType(role.role) + ')' : '',
                [TABLEFIELDMAPPING.colorText]: false
            });
        }
    }
    return ret;
}

//Formatting event or relation cluster details
export function formatSinHypothesisMember(data) {
    let memberType = getType(data.type);
    return {
        [TABLEFIELDMAPPING.headline]: getId(data.node),
        [TABLEFIELDMAPPING.id]: getId(data.node),
        [TABLEFIELDMAPPING.idUri]: data.node,
        [TABLEFIELDMAPPING.category]: getType(data.category),
        [TABLEFIELDMAPPING.types]: [memberType],
        [TABLEFIELDMAPPING.entityList]: data.roles.length > 0 ? formatSinHypothesisArguments(data.roles, memberType) : {},
    };
}

//Formatting SINs comparison
export function formatSinsComparison(data, category, type) {
    const members = deduplicateArray(data.members.map(member => formatSinHypothesisMember(member)));

    return  {
        [TABLEFIELDMAPPING.headline]: getId(data.hypothesis),
        [TABLEFIELDMAPPING.idUri]: data.hypothesis,
        [TABLEFIELDMAPPING.roles] : data.roles,
        [TABLEFIELDMAPPING.category]: category,
        [TABLEFIELDMAPPING.clusterCategory]: data.category,
        [TABLEFIELDMAPPING.clusterType]: type,
        [TABLEFIELDMAPPING.clusterList]: members,
        [TABLEFIELDMAPPING.percentage] : data[TABLEFIELDMAPPING.percentage] ? data[TABLEFIELDMAPPING.percentage] : undefined,
        [TABLEFIELDMAPPING.highlight] : data[TABLEFIELDMAPPING.highlight] ? data[TABLEFIELDMAPPING.highlight] : false,
        [TABLEFIELDMAPPING.compare] : false
    };
}

function getDateParts(date) {
    //TODO: Is there a discrepancy here in the formatting
    if (!date) {
        return '';
    }
    const splitDate = date.split('--');
    //using provided year since all of the years in the data could not be accurately converted (e.g. 0001, 9999)
    const dateYear = splitDate[0] || '????';
    const hasDash = splitDate[1].includes('-');
    const dateMonth = hasDash ? '???' : new Date(null, splitDate[1], null).toLocaleString('en-us', { month: 'short' });
    const dateDay = hasDash ? splitDate[1] : splitDate[2] || '-??';

    return [dateYear, dateMonth, dateDay.substring(1)];
}

function combineParts(parts) {
    return parts.join(' ');
}

function combineDates(start, end) {
    let combined = '';
    if(start && end) {
        combined = start + ' \u2013 ' + end;
    }
    else {
        combined = start ? start : end;
    }
    return combined;
}

export function getDateString(date) {
    const start = getDateParts(date.startAfter || date.startBefore);
    const end = getDateParts(date.endBefore || date.endAfter);

    const startString = start ? combineParts(start) : '';
    const endString = end ? combineParts(end) : '';

    const [sY, sM, sD] = start;
    const [eY, eM, eD] = end;

    // different years
    if (sY !== eY) {
        return combineDates(startString, endString);
    }

    // different months
    if (sM !== eM) {
        return combineDates(startString, combineParts([eM, eD]));
    }

    // different days
    if (sD !== eD) {
        return combineDates(startString, eD);
    }

    // all equal
    return startString;
}

export function formatSinsClaims(data, category, type) {
    return  {
        [TABLEFIELDMAPPING.clusterUri]: data.node,
        [TABLEFIELDMAPPING.clusterCategory]: data.category,
        [TABLEFIELDMAPPING.clusterType]: type,
        [TABLEFIELDMAPPING.id]: '',
        [TABLEFIELDMAPPING.prototypeUri] : data.prototype,
        [TABLEFIELDMAPPING.statement]: '',
        [TABLEFIELDMAPPING.dates]: data.dates && [...new Set(data.dates.map(getDateString))].sort(),
        [TABLEFIELDMAPPING.category]: category,
        [TABLEFIELDMAPPING.hypothesisList]: data.hypotheses,
        [TABLEFIELDMAPPING.entityList]: data.roles.length > 0 ? formatSinHypothesisArguments(data.roles, type) : {},
        [TABLEFIELDMAPPING.documentList] : []
    };
}

function formatUniqueMembers(member, category, entities) {
    const clusters = member.clusters && member.clusters.map(cluster => ({
        [TABLEFIELDMAPPING.types]: getSortedTypes(cluster.types),
        [TABLEFIELDMAPPING.clusterUri]: cluster.id,
        [TABLEFIELDMAPPING.id]: getId(cluster.id),
        [TABLEFIELDMAPPING.category]: category
    }));

    return createMember(member, category, entities, clusters);
}

function formatClusterElement(member, category) {
    const entityClusters = formatPrototypeArguments(member.arguments, category);
    return(formatUniqueMembers(member, category, entityClusters))
}

function reduceSets(entities) {
    const formattedEntities = [...entities.values()];

    for (const fe of formattedEntities) {
        fe[TABLEFIELDMAPPING.types] = sortCaseInsensitive([...fe[TABLEFIELDMAPPING.types]]);
        fe[TABLEFIELDMAPPING.roles] = sortCaseInsensitive([...fe[TABLEFIELDMAPPING.roles]]);

        if(fe[TABLEFIELDMAPPING.clusterIdList]) {
            fe[TABLEFIELDMAPPING.clusterIdList] = sortCaseInsensitive([...fe[TABLEFIELDMAPPING.clusterIdList]]).flatMap(getClusterIdObject);
        }
    }
    return formattedEntities;
}

export function formatPrototypeArguments(entities, category) {
    const map = new Map();
    for (const entity of entities) {
        const role = getRole(entity.role);
        for (const filler of entity.fillers) {
            const types = filler.types.map(getType);
            const clusterIdList = filler.clusterIds;

            let formattedFiller = map.get(filler.id);
            if (!formattedFiller) {
                formattedFiller = {
                    [TABLEFIELDMAPPING.headline]: category && category === DATATYPES.sin.id ? getName(filler, false): getName(filler),
                    [TABLEFIELDMAPPING.names]: filler.names,
                    [TABLEFIELDMAPPING.roles]: new Set([role]),
                    [TABLEFIELDMAPPING.types]: new Set(types),
                    [TABLEFIELDMAPPING.id]: getId(filler.id),
                    [TABLEFIELDMAPPING.idUri]: filler.id,
                    [TABLEFIELDMAPPING.category]: 'entity'
                };

                if(clusterIdList) {
                    formattedFiller[TABLEFIELDMAPPING.clusterIdList] = new Set([...clusterIdList]);
                }
                map.set(filler.id, formattedFiller);
            } else {
                for (let type of types) {
                    formattedFiller[TABLEFIELDMAPPING.types].add(type);
                }

                if(clusterIdList) {
                    for (let item of clusterIdList) {
                        formattedFiller[TABLEFIELDMAPPING.clusterIdList].add(item);
                    }
                }

                formattedFiller[TABLEFIELDMAPPING.roles].add(role);
            }
        }
    }
    return reduceSets(map);
}

//Formatting event or relation element details
export function formatElementMembers(member, category) {
    return(formatDuplicateMembers(member, category, formatPrototypeArguments(member.arguments)));
}

function formatDuplicateMembers(member, category, entities) {
    const map = new Map();

    for (const cluster of member.clusters) {
        const types = cluster.types.map(getType);

        let clusterMember = map.get(cluster.id);
        if (!clusterMember) {
            clusterMember = {
                [TABLEFIELDMAPPING.types]: new Set(types),
                [TABLEFIELDMAPPING.clusterUri]: cluster.id,
                [TABLEFIELDMAPPING.id]: getId(cluster.id),
                [TABLEFIELDMAPPING.category]: category
            };
            map.set(cluster.id, clusterMember);
        } else {
            for (let type of types) {
                clusterMember[TABLEFIELDMAPPING.types].add(type);
            }
        }
    }

    const formattedCluster = [...map.values()];
    for (const fc of formattedCluster) {
        fc[TABLEFIELDMAPPING.types] = sortCaseInsensitive([...fc[TABLEFIELDMAPPING.types]]);
    }

    return createMember(member, category, entities, formattedCluster);
}


