//Formatting entity element details
export function formatEntityMembers(member) {
    const connections = formatEntityConnection(member.connections);
    const clusters = member.clusters && member.clusters.map(cluster => ({
        [TABLEFIELDMAPPING.headline]: getName(cluster),
        [TABLEFIELDMAPPING.names]: cluster.names,
        [TABLEFIELDMAPPING.clusterUri]: cluster.id,
        [TABLEFIELDMAPPING.types]: getSortedTypes(member.types),
        [TABLEFIELDMAPPING.id]: getId(cluster.id),
        [TABLEFIELDMAPPING.category]: 'entity'
    }));

    return {
        [TABLEFIELDMAPPING.headline]: getName(member),
        [TABLEFIELDMAPPING.names]: member.names,
        [TABLEFIELDMAPPING.idUri]: member.id,
        [TABLEFIELDMAPPING.id]: getId(member.id),
        [TABLEFIELDMAPPING.types]: getSortedTypes(member.types),
        [TABLEFIELDMAPPING.eventList]: connections.filter(connection => connection[TABLEFIELDMAPPING.category] === 'event'),
        [TABLEFIELDMAPPING.relationList]: connections.filter(connection => connection[TABLEFIELDMAPPING.category] === 'relation'),
        [TABLEFIELDMAPPING.nodeCount]: clusters && clusters.length,
        [TABLEFIELDMAPPING.clusterList]: clusters,
        [TABLEFIELDMAPPING.documentList]: member.docs,
        [TABLEFIELDMAPPING.category]: 'entity'
    }
}

function formatEntityConnection(entities) {
    const map = new Map();

    for (const entity of entities) {
        const role = getRole(entity.role);
        for (const connection of entity.connections) {
            const types = connection.types.map(getType);

            let formattedConnection = map.get(connection.id);
            if (!formattedConnection) {
                formattedConnection = {
                    [TABLEFIELDMAPPING.roles]: new Set([role]),
                    [TABLEFIELDMAPPING.types]: new Set(types),
                    [TABLEFIELDMAPPING.id]: getId(connection.id),
                    [TABLEFIELDMAPPING.idUri]: connection.id,
                    [TABLEFIELDMAPPING.category]: getType(entity.category).toLowerCase()
                };
                map.set(connection.id, formattedConnection);
            } else {
                for (let type of types) {
                    formattedConnection[TABLEFIELDMAPPING.types].add(type);
                }

                formattedConnection[TABLEFIELDMAPPING.roles].add(role);
            }
        }
    }

    return reduceSets(map);
}

function countHypothesisNodes(node) {
