//Formatting table data
export function formatClusterTableData(data, category) {
    let clusters = {};
    for (const row of data) {
        let clusterUri = category === DATATYPES.hypothesis.id ? row[DATATYPES.hypothesis.id] : row[TABLEFIELDMAPPING.clusterUri];
        let cluster = clusters[clusterUri];
        let clusterId = getId(clusterUri);

        if (!cluster) {
            cluster = {
                [TABLEFIELDMAPPING.clusterUri]: clusterUri,
                [TABLEFIELDMAPPING.id]: clusterId,
                [TABLEFIELDMAPPING.headline]: clusterId,
                [TABLEFIELDMAPPING.category]: category,
                [TABLEFIELDMAPPING.nodeCount]: row['argumentCount']
            };

            if(category === DATATYPES.hypothesis.id) {
                cluster[TABLEFIELDMAPPING.nodes] = countHypothesisNodes(row);
            }
            else {
                let prototypeUri = row[TABLEFIELDMAPPING.prototype];
                let prototypeId = getId(prototypeUri);

                cluster[TABLEFIELDMAPPING.types] = sortCaseInsensitive([...new Set( row[TABLEFIELDMAPPING.types].flatMap(getType))]);
                cluster[TABLEFIELDMAPPING.prototypeUri] = prototypeUri;
                cluster[TABLEFIELDMAPPING.prototypeId]= prototypeId;
                cluster[TABLEFIELDMAPPING.prototype] = {};
            }

            clusters[clusterUri] = cluster;
        }
    }
    return Object.fromEntries(Object.entries(clusters).sort());
}

export function formatESData(category, sin) {
    let eventClusterBySin = new Map();
    let entityByEventCluster = new Map();
    let summaryItems = [];
    for (const cluster of sin) {
        //if there are no arguments then there is no need to show the member
        if (cluster.entities && cluster.entities.length > 0) {
            const clusterId = cluster.cluster;
            const clusterSin = cluster.sin;
            const joinedId = clusterSin + JOINSTRING + clusterId;
            if(!eventClusterBySin.has(clusterSin)) {
                eventClusterBySin.set(clusterSin, new Map())
            }

            if(!eventClusterBySin.get(clusterSin).has(clusterId)) {
                eventClusterBySin.get(clusterSin).set(clusterId, new Map());
            }

            if(!entityByEventCluster.has(joinedId)) {
                entityByEventCluster.set(joinedId, new Map());
            }

            let roles = [];
            for(const entity of cluster.entities) {
                entity[TABLEFIELDMAPPING.clusterType] = cluster.cluster_type;
                let entityRoles = [];
                for(const role of entity[TABLEFIELDMAPPING.roleUri]) {
                    entityRoles.push(removePrefix(role, PREFIXTYPES.underscore));
                }
                entity[TABLEFIELDMAPPING.roles] = entityRoles;
                roles = [...roles, ...entityRoles];

                if(!entityByEventCluster.get(joinedId).has(entity.id)) {
                    entityByEventCluster.get(joinedId).set(entity.id, []);
                }
                entityByEventCluster.get(joinedId).get(entity.id).push(entity);
            }

            const date = cluster.date ? cluster.date.toString() : null;
            const key = cluster[TABLEFIELDMAPPING.statement] + date;
            let data = {
                [TABLEFIELDMAPPING.headline]: getId(cluster.hypothesis),
                [TABLEFIELDMAPPING.idUri] : cluster.hypothesis,
                [TABLEFIELDMAPPING.roles]: roles,
                [TABLEFIELDMAPPING.sinId]: clusterSin,
                [TABLEFIELDMAPPING.category]: DATATYPES.sin.id,
                [TABLEFIELDMAPPING.statement] : cluster.statement,
                [TABLEFIELDMAPPING.clusterCategory]: cluster.cluster_category,
                [TABLEFIELDMAPPING.sinTitle]: upperFirstLetter(cluster.cluster_category) + ' - ' + cluster.cluster_type,
                [TABLEFIELDMAPPING.clusterType]: cluster.cluster_type,
                [TABLEFIELDMAPPING.compare]:false,
                [TABLEFIELDMAPPING.highlight]:false,
                [TABLEFIELDMAPPING.percentage]:undefined,
                [TABLEFIELDMAPPING.clusterList]: [cluster],
                [TABLEFIELDMAPPING.id] : key,
                [TABLEFIELDMAPPING.dates]: cluster.date,
                [TABLEFIELDMAPPING.route] : DATASOURCEURI + 'TA3/' + cluster.sin + '/' + cluster.run
            };

            if(!eventClusterBySin.get(clusterSin).get(clusterId).has(cluster.hypothesis)) {
                eventClusterBySin.get(clusterSin).get(clusterId).set(cluster.hypothesis, data);
            }
        }
    }

    let clustersBySin = {};
    for (const [sinKey, clusterMap] of eventClusterBySin.entries()) {
        let clusters = {};
        for (const [clusterKey, clustersByHypothesis] of clusterMap.entries()) {
            const hypotheses = [ ...clustersByHypothesis.keys()];
            const values = [ ...clustersByHypothesis.values()];

            //if there are enough values to compare, more than one value
            if(values.length > 1) {
                const clusterEntities = entityByEventCluster.get(sinKey + JOINSTRING + clusterKey);
                let summaryData = {};

                summaryData[TABLEFIELDMAPPING.id] = clusterKey;
                summaryData[TABLEFIELDMAPPING.sinId] = values[0][TABLEFIELDMAPPING.sinId];
                summaryData[TABLEFIELDMAPPING.category] = DATATYPES.eventType.id;
                summaryData[TABLEFIELDMAPPING.clusterCategory] = values[0][TABLEFIELDMAPPING.clusterCategory];
                summaryData[TABLEFIELDMAPPING.entityCount] = 'Entities: ' + clusterEntities.size;
                summaryData[TABLEFIELDMAPPING.nodeCount] = 'Claims: ' + hypotheses.length;
                summaryData[TABLEFIELDMAPPING.route] = convertTA3toTA2Route(values[0][TABLEFIELDMAPPING.route]);

                let entityList = [];
                for(const entity of clusterEntities.values()) {
                    //if this entity appears at least 1 time for each hypothesis in the cluster, it should be added to the summary description
                    if(entity.length >= hypotheses.length) {
                        entityList.push(entity[0]);
                    }
                }

                const identifiers = getEntityIdentifiers(entityList);
                const clusterType = values[0][TABLEFIELDMAPPING.clusterType];
                const summary = getTemplate(clusterType, identifiers);
                summaryData[TABLEFIELDMAPPING.headline] = summary;
                clusters[summary + JOINSTRING + clusterKey] = values;
                summaryItems.push(summaryData);
            }
        }

        clustersBySin[sinKey] = clusters;
    }

    //updates the sin summaries and details
    summaryItems = sortArrayOfObjects(summaryItems, TABLEFIELDMAPPING.headline);
    return {[DATATYPES.summary.id]: summaryItems, [DATATYPES.eventType.id]: clustersBySin};
}

//statement template functions
export function getEntityName(e) {
    let ret = e[TABLEFIELDMAPPING.headline];
    if (!ret || ret.includes('UNKNOWN')) {
        //types filter checks for all types with two periods or one period, then takes the first one
        let designatedType = e[TABLEFIELDMAPPING.types].find(t => t.match('(?:\\w+(?:\\.\\w+)){2}')) || e[TABLEFIELDMAPPING.types].find(t => t.match('(?:\\w+(?:\\.\\w+)){1}'));
        designatedType = designatedType ? getLastSubType(designatedType) : e[TABLEFIELDMAPPING.types][0];
        ret = getTransformedType(designatedType, CategoryTypes.entityTypeMapping);
    }
    if (e.discrepancy) {
        ret += ' ' + e.discrepancy;
    }
    return ret;
}

export function getEntityIdentifiers(entities) {
    const args = {};
    for ( const entity of entities) {
        let role = entity[TABLEFIELDMAPPING.roles][0];
        let clusterType = entity[TABLEFIELDMAPPING.clusterType];

        //Annotation entry error fix, if role is Victim instead of Target, the template cannot be fully applied
        if(role === 'Victim' && clusterType === 'Conflict.Attack') {
            role = 'Target';
        }

        if (!args[role]) {
            args[role] = [];
        }
        args[role].push(getEntityName(entity));
    }
    return args;
}

function combineTemplateArgs(templateArgs) {
    if(Array.isArray(templateArgs) && templateArgs.length > 1) {
        templateArgs = [...templateArgs];
        templateArgs[templateArgs.length - 1] = 'and ' + templateArgs[templateArgs.length - 1];
        templateArgs = templateArgs.join(templateArgs.length === 2 ? ' ' : ', ');
    }
    return templateArgs;
}

export function getOriginalTemplate(type, args) {
    const templateObj = templates.original[type];
    let template = templateObj.template;
    for (const [i, arg] of templateObj.args.entries()) {
        template = template.replace('<arg' + (i + 1) + '>', combineTemplateArgs(args[arg]) || '?');
    }
    return template;
}

export function getTemplate(type, args) {
    const templateObj = templates.original[type];
    const parts = templates.augmented[templateObj.template];
    if (!parts) {
        return getOriginalTemplate(type, args);
    }
    let template = '';
    for (const index of parts.order) {
        const part = parts[index];
        if (typeof index === 'string') {
            template += index;
        } else {
            let templateArgs = args[templateObj.args[index - 1]] || part.substitution;
            if (!templateArgs) {
                continue;
            }
            templateArgs = combineTemplateArgs(templateArgs);
            if (part.prefix) {
                template += part.prefix;
            }
            template += templateArgs;
            if (part.suffix) {
                template += part.suffix;
            }
        }
    }

    return template;
}

export function getTemplatePredicate(type) {
    const templateObj = templates.original[type];
    const parts = templates.augmented[templateObj.template];
    let predicate = null;
    for (const index of parts.order) {
        if (typeof index === 'string') {
            predicate = index;
            break;
        }
    }

    return predicate;
}

function replaceCamelCase(string, replacement) {
    return string.replace(/(?<=[a-z])(?=[A-Z])/g, replacement)
}
export function getTypesFromQuery(query) {
    const ret = [];
    // remove non alpha characters from query and split into words
    for (const kept of query.toLowerCase().replace(/[^a-z ]+/g,'').split(' ').filter(str => !stringsToIgnore.has(str))) {
        // find in types and templates
        for (const [type, value] of Object.entries(templates.original)) {
            // check whether query word matches a string from type, the template, or an argument
            if (replaceCamelCase(type, '.').toLowerCase().split('.').includes(kept) ||
                value.template.toLowerCase().split(' ').includes(kept) ||
                value.args.flatMap(a => replaceCamelCase(a, ' ').toLowerCase().split(' ')).includes(kept) ) {
                ret.push(type);
            }
        }
    }
    return ret.length ? ret : undefined;
}
